import logo from './logo.svg';
import './App.css';
import Dashboard from './components/Dashboard/Dashboard';
import Preferences from './components/Preferences/Preferences';
import {
  BrowserRouter,
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams
} from "react-router-dom";

function App() {
  return (
    <div className="wrapper">
      <h1>Application</h1>
      <BrowserRouter>
        <ul>
            <li>
              <Link to="/" component={Dashboard}>Home</Link>
            </li>
            <li>
              <Link to="/dashboard"  component={Dashboard}>Dashboard</Link>
            </li>
            <li>
              <Link to="/preferences"  component={Preferences}>Preferences</Link>
            </li>
          </ul>


      </BrowserRouter>
    </div>
  );
}

export default App;
